function initSidebar(){$(".sidebar .btn-sidebar").click(sidebar);$(".sidebar .sidebar-prompt").click(sidebar);$(".sidebar ul li ul li").click(function(){$(".sidebar ul li ul li.active").removeClass("active");$(this).addClass("active")})}function sidebar(){$(".sidebar .btn-sidebar").toggleClass("btn-side");$(".sidebar").toggleClass("side");$(".sidebar > div").toggleClass("sidebar-prompt");if($(".sidebar").hasClass("side")){$(".sidebar").prev().css("width","calc( 100% - 225px)")}else{$(".sidebar").prev().css("width","calc( 100% - 25px)")}}function addSidebarClickEventHandlerFunction(a){$(".sidebar:eq(0)").click(function(){setTimeout(a,500)});$(window).resize(a)}function registListenerForSidebar(){$("#index-body-chart #index-body-sidebar ul li ul li").click(function(){loadSingleChart($(this).children().text())})}function loadSingleChart(a){$.each(chart_components,function(b,c){if(c.cname===a){$("#index-body-chart #index-body-chart-container").empty();loadSingleComponent(c,"#index-body-chart #index-body-chart-container");return false}})};